@iamkatiereed flew down for less than 24 hours so we could do her maternity photos! I am HONORED to capture this absolute goddess, she is one of the purest souls I know. We were able to do a grand total of four looks with the help of @the.cabanaclub and @thedressrentalco! I am so excited to edit these. I mean, LOOK AT HER! 

Yes, I’m crazy. I came home from NYFW and had basically two days to recover but filled it with this glorious opportunity and now I’m editing on our road trip to south Florida for @ebetxo and Kenny’s wedding! Things might calm down next week, probably not though. 😘 

#photographyreels #beachmaternity #thirdtrimester #stpetephotographer #tampaphotographer #vintagematernity #vintagebeach #beachbump #maternityreels #maternityphotography

My 2023 goal is to do one creative shoot a week. Here is February! Of course, the incredible week in New York added way more than just one set and that was INCREDIBLE. She deserves a moment of her own. @stylistamandaelaine is a goddess and the real MVP for bringing us all together and another reel will be coming for that soon - waiting on publications to release! 
Thank you to everyone involved this month, you all inspire me! 
